class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      rows: [],
    };
  }

  componentDidMount() {
    this.loadData();
  }

  async loadData() {
    const res = await fetch("http://localhost:8801/design/users/getAllUsers");
    console.log("res = ", res);
    try {
      const result = await res.json();
      console.log("result = ", result);
      this.setState({
        rows: result,
      });
    } catch (Exception) {
      console.log("result = ", Exception);
    }
  }
  render() {
    const rows = this.state.rows;
    return (
      <div className="App">
        <header className="App-header">
          <p>Jesus Lorca Luque</p>
          <UsersTable rows={rows} />
        </header>
      </div>
    );
  }
}

export default App;
